import MapView from "react-native-maps";

const Map = () => {
  const region = {
    latitude: 37.78,
    longtitude: -122.43,
    latitudeDelta: 0.0922,
    longtitudeDelta: 0.0421,
  };

  return <MapView initialRegion={region}></MapView>;
};

export default Map;
